// ==UserScript==
// @name Wikipedia Dark mode
// @namespace git.arun.cloud/arun/userstyles
// @version 1.0.0
// @description A new userstyle
// @author arunsunner
// @grant GM_addStyle
// @run-at document-start
// @match *://*.wikipedia.org/*
// @match *://*.mediawiki.org/*
// @match *://*.wikimedia.org/*
// @match *://*.wikibooks.org/*
// @match *://*.wikidata.org/*
// @match *://*.wikiquote.org/*
// @match *://*.wikiversity.org/*
// @match *://*.wiktionary.org/*
